import React from "react";
import "./sytl";

function Home() {
  return (
    <div className='home'>
      <div className='home-content'>
        <h1>Welcome to SmartCodeHub</h1>
        <p>Your AI-powered code snippet manager.</p>
      </div>
    </div>
  );
}

export default Home;
